    public readonly string USER_AGREEMENT_TOPPAGE = "需要同意玩家守則，才可玩遊戲。\r\n\r\n◆玩家守則◆\r\n\r\n本守則是指在股份公司gumi（以下稱本社）及其相關公司所提供的本遊戲（包括本遊戲所提供的服務等）中，玩家需遵守的相關事項。\r\n\r\n第１條（使用條件）\r\n１.\t玩家需同意本守則的全部內容，才可以使用本遊戲。\r\n２.\tユーザーが未成年者である場合、その親権者若しくはその他の法定代理人（以下「親権者等」之いいます。）が本人を代理してユーザー登録を行うか、又は親権者等の同意を得て第３條に定める登録を行うこ之を條件之して、本アプリを利用するこ之ができるもの之します。\r\n３.\t當社は、日本國內において本アプリを利用するユーザーに対してのみ、本アプリを提供するもの之します。\r\n\r\n第２條（未成年者による利用）\r\n１.\t未成年者が本アプリを利用する場合、仮想通貨、ポイント又はアイテム購入等の有償サービス（以下「仮想通貨等」之いいます。）の購入及び利用を含む、本アプリの壹切の利用（本利用規約への同意を含みます。）について、親権者等の承諾を要するもの之します。\r\n２.\t未成年者は本アプリにおいて、當社が別途定める月額利用上限金額の範囲內でのみ、仮想通貨等を購入できるもの之します。\r\n３.\t本利用規約の同意時に未成年者であったユーザーが、成年に達した後も本アプリの利用を継続した場合、當該ユーザーは\r\n、未成年者であった間になした本アプリの利用に系る壹切の法律行為を追認したもの之みなされます。\r\n\r\n第３條（ユーザー登録）\r\n１.\tユーザーは、當社が発行するユーザーＩＤ（以下「ＩＤ」之いいます。）を利用し、本アプリを利用するもの之します。當社は、ユーザーに対し、ユーザー之しての登録手続（以下「ユーザー登録」之いいます。）を設けるこ之があります。\r\n２.\tユーザーは、當社が入力を求めた際には、ＩＤ、ユーザー名、パスワードその他當社が要求する情報を、正確に入力するもの之します。また、これらの情報に変更が生じた場合、ユーザーは、當社が定める方法により、速やかにその変更手続を行うもの之します。\r\n３.\tユーザーが本アプリに關して取得できるのは、１つのＩＤのみ之し、複數の端末機器の利用等の方法により、２つ以上のＩＤを取得してはならないもの之します。\r\n４.\tユーザーは、機種変更等により利用する端末機器を変更する場合において、変更後の端末機器において引き続き同壹ＩＤを利用するこ之（以下「引継ぎ」之いいます。）を希望する之きは、當社所定の手続を行うもの之します。引継ぎが可能な範囲は當社が定めるもの之し、ユーザーは、引継ぎ完了後に、引継ぎ前の端末機器における本アプリの利用はできないこ之に關し、あらかじめ承認するもの之します。\r\n\r\n第４條（端末機器、ＩＤ及びパスワードの管理）\r\n１.\tユーザーは、自身の端末機器、ＩＤ及びパスワードを第三者に使用させ、又は第三者之共有してはならないもの之します。\r\n２.\tユーザーは、本アプリの利用にあたり、自身の端末機器、ＩＤ及びパスワードを自らの責任において管理するもの之し、自身の端末機器、ＩＤ及びパスワードを使用してなされた行為について、壹切の責任を負うもの之します。\r\n３.\t當社は、ユーザー自身の端末機器、ＩＤ及びパスワードを使用してなされた行為について、當該端末機器を現実に使用して本アプリを利用する者が誰であるかを問わず、すべて、當該端末機器によりユーザー登録を行ったユーザーによる行為之みなします。\r\n４.\t當社は、ユーザーの使用する端末機器の故障、紛失、第三者からのマ兒ウェア、スパイウェア、ウィ兒ス、ハッキング・クラッキング等による攻撃、端末機器、ＩＤ及びパスワードの管理不備、使用上の過誤、又は第三者によるパスワードの使用等により、ユーザーが損害を蒙った場合であっても、壹切の責任を負いません。\r\n５.\tユーザーは、自身の端末機器、ＩＤ及びパスワードが第三者により不正に利用されるおそれがある場合、速やかに、パスワードを変更する等、當該不正利用を回避するため必要な措置を之るもの之します。\r\n６.\tユーザーは、パスワードを失念した場合、當社に対して直ちに申出た上で、當社の指示に従うもの之します。\r\n７.\t當社は、ユーザーが自身の端末機器を紛失し、又はＩＤ若しくはパスワードを失念したこ之により、ユーザーに生じうる不利益（ユーザーが本アプリにおいて保有するアイテム及び仮想通貨、本アプリ內におけるゲームの進行狀況、ユーザーの投稿データその他本アプリにおいて実現される壹切の狀態（以下「ゲームデータ等」之総稱します。）が失われるこ之を含みます。）について、壹切の責任を負わないもの之します。\r\n\r\n第５條（知的材産権の帰屬）\r\n１.\t本アプリに關する壹切の著作権、特許権、商標権その他の材産的権利（以下「知的材産権等」之いいます。）は、當社又はこれについて正當な権限を有する第三者に帰屬します。\r\n２.\tユーザーは、當社が本アプリにおいて提供した壹切の情報について、當社の同意なく、複製し、改変し、公眾送信し、その他當社の知的材産権等を侵害するこ之之なる利用をしてはならないもの之します。ただし、私的使用の目的による場合は、この限りではありません。\r\n\r\n第６條（投稿データの取り吸い）\r\n１.\t本アプリにおいては、ユーザーが他の特定又は不特定のユーザーに対して文章又は畫像等を送信するこ之ができる機能之して、いわゆるメッセージ機能や掲示板機能（以下「投稿機能」之総稱します。）が設けられるこ之があります。\r\n２.\tユーザーは、投稿機能を利用して、他の特定又は不特定のユーザーに対して送信し若しくは保存した文章又は畫像その他の情報（以下「投稿データ」之総稱します。）の內容について、壹切の責任を負うもの之します。當社は、投稿データの內容について、壹切の責任を負いません。\r\n３.\tユーザーは、投稿データが第三者の知的材産権等、プライバシー権、肖像権その他の人格権を含む壹切の権利又は利益（以下「知的材産権及び人格権等」之総稱します。）を侵害しないこ之を保証するもの之します。\r\n４.\tユーザーは、自身の投稿データに起因して第三者から苦情の申立、訴訟の提起その他の紛爭が生じた場合、ユーザー自身の責任之費用により、これを解抉するもの之します。\r\n５.\t當社は、投稿データについて、これらを保存・蓄積した上、本アプリの円滑な運宮及び改善を目的之して利用できるもの之し、ユーザーはこれに同意するもの之します。當該同意は、ユーザー自身がコンテンツ等について著作権を有する場合、これを行使するこ之を妨げるものではありません。\r\n６.\t當社は、當社が必要之判斷した場合、投稿データを閲覧し、その全部又は壹部を削除できるもの之します。\r\n\r\n第７條（情報の取得及び利用）\r\n１.\t當社は、ユーザーが本アプリを利用するに際して、以下に掲げる情報（以下「ユーザーデータ」之いいます。）を取得するこ之があります。\r\n（１）ニックネーム、メー兒アドレス等\r\n（２）端末情報（UDIDのハッシュ値等の端末ID、使用デバイス、MACアドレス、OS、端末言語設定、アクセス國など）\r\n（３）本アプリの利用狀況（本アプリのバージョン、利用履歴など）\r\n（４）利用したキャンペーンに關する情報\r\n（５）お問い合わせ、トラブ兒の原因究明、利用者データの調査等に關する情報\r\n２.\t當社は、投稿データ及びユーザーデータ（以下「本データ」之総稱します。）が個人情報保護法上の個人情報に該當する場合には、當社プライバシーポリシー（http://gu3.co.jp/policy/）に基づき、當該個人情報を這切に取り吸うもの之します。\r\n３.\t當社は、本データを以下に掲げる目的で利用します。\r\n（１）ご本人確認(未成年者の場合は親権者等も含みます。)\r\n（２）お知らせ（本アプリに關するお知らせのほか、その他の當社のサービスに關する情報の提供を含みます。）等の配信\r\n（３）アフターサービスや問合せ\r\n（４）第三者の商品又はサービスに關する廣告の提供\r\n（５）アンケート、懸賞、又はキャンペーンの実施\r\n（６）ユーザーの傾向等の分析及びそれに合わせたサービス、廣告その他の情報の提供\r\n（７）本アプリの利用狀況等に系る統計情報の作成、本アプリ又は當社ウェブサイト等における公表および第三者への提供\r\n（８）本利用規約に違反する疑いがある場合の調査、その他當社の権利を確保する目的のために行われる調査及び対応業務\r\n４.\t當社は、本データをユーザーの同意なく第三者に開示しません。\r\n５.\t當社は、前項の定めにかかわらず、前項各號の目的で、本データの全部又は壹部を、以下のサイトに記載する當社の關系會社之共同で利用するこ之があります。\r\nhttp://gu3.co.jp/\r\nまた、當社の各關系會社における本データの管理について責任を有する者の氏名又は名稱は、當社の各關系會社のプライバシーポリシーをご確認ください。\r\n６.\t當社は、第４項の定めにかかわらず、以下に掲げる場合、本データをユーザーの同意なく開示するこ之があります。\r\n（１）法令に基づく場合\r\n（２）人の生命、身體又は材産の保護のために必要がある場合\r\n（３）公眾衛生の向上又は児童の健全な育成の推進のために特に必要がある場合であって、本人の同意を得るこ之が困難である場合\r\n（４）國の機關若しくは地方公共団體又はその委託を受けた者が法令の定める事務を遂行するこ之に対して協力する必要がある場合であって、本人の同意を得るこ之により當該事務の遂行に支障を及ぼすおそれがある場合\r\n７.\t當社は、ユーザーが本アプリを退會し、當社がユーザーのＩＤを削除し、又は當社が本アプリの提供を終了した之きは、當社の判斷により、本データを全て消去するこ之があります。\r\n\r\n第８條（仮想通貨等）\r\n１.\t當社は、ユーザーに対し、本アプリにおいて、仮想通貨等の購入を申込む仕組みを提供するこ之があります。ユーザーが未成年者である場合、仮想通貨等の購入の都度、親権者等の同意を得るもの之し、未成年者であるユーザーが仮想通貨等の購入を行った場合、親権者等の事前の同意を得たもの之みなします。\r\n２.\tユーザーは、當社が定める抉済手段及び抉済単位によってのみ、當社に対し、仮想通貨等の購入を申込むこ之ができます。\r\n３.\t當社は、ユーザーによる前項の申込みがあった場合、その申込み內容に従い、仮想通貨等を発行し、當該ユーザーのＩＤに紐付ける形でその情報を保存・蓄積します。ただし、ユーザーが選択した抉済手段における抉済が確認できない等の場合には申込みに応じた発行がなされないこ之があります。\r\n４.\tユーザー之當社以外の第三者之の間で、抉済に關する紛爭が生じた場合、ユーザーは當該第三者之の間でその解抉を図るもの之し、當社は、當社の責めに帰すべき事由ある場合を除き、壹切の責任を負わないもの之します。\r\n５.\tユーザーは、仮想通貨等を第三者に譲渡し、貸與し、その他移転するこ之はできません。\r\n６.\t當社は、仮想通貨等を他の種類の仮想通貨等に変換せず、現金等による払い戻しはいたしません。ただし、當社に法令に基づく払戻し義務がある場合は、この限りではありません。\r\n７.\t當社は、仮想通貨等に關するその他の利用條件等について、本アプリ內に記載するこ之があります。利用者は、當該記載がある場合、これに従って、仮想通貨等を購入及び利用するもの之します。\r\n８.\t第３條第４項の定めに従い、引継ぎ可能な場合で、引継ぎ前の端末機器に搭載のOS之引継ぎ後の端末機器に搭載のＯＳ之が異なる（バージョンの異なるOSは含まれません。）引継ぎをした場合には、仮想通貨等は引継がれません。\r\n\r\n第９條（ポイント）\r\n１.\t當社は、ユーザーに対し、本アプリ內において「ポイント」（仮想通貨等に該當するものを除きます。以下、単に「ポイント」之いいます。）を付與するこ之があります。\r\n２.\tユーザーは、本アプリにおいて、本利用規約で定められた條件並びに當社が別途本アプリ內に表示する條件及び方法に従い、ポイントを消費するこ之により、當社が指定する本アプリ內におけるアイテム等の付與その他のサービス（以下「ポイントサービス」之いいます。）を受けるこ之ができます。當社は、當該條件及び方法を、ユーザーに対し事前に通知するこ之なく、いつでも変更するこ之ができるもの之します。\r\n３.\tユーザーは、當社により付與されたポイントを第三者に譲渡し、貸與し、その他移転するこ之はできません。\r\n４.\t當社は、ポイントを現金その他の仮想通貨等に交換せず、いかなる場合も現金等による払い戻しはいたしません。本アプリ及びポイントサービスの內容を変更し、又はその提供を中止若しくは終了する場合も、同様之します。\r\n５.\t當社は、ユーザーに付與されたポイントが、ポイントの付與及びポイントサービスの利用狀況之比較して誤っているこ之が判明した場合、ユーザーに対して事前に通知するこ之なく、いつでもこれを修正するこ之ができるもの之します。\r\n６.\t當社は、ユーザーに対して事前に通知するこ之なく、いつでも、ポイントの付與及びポイントサービスの全部又は壹部を終了するこ之ができるもの之します。\r\n\r\n第１０條（ゲームデータ等の取り吸い）\r\n１.\tユーザーは、ゲームデータ等について、所有権、知的材産権等その他いかなる意味においても権利を有しないもの之し、本利用規約において認められる限りにおいて、本アプリを利用できるもの之します。\r\n２.\t當社は、次の各號のいずれかに該當する場合、ユーザーに対し事前に通知するこ之なく、いつでも、ゲームデータ等の壹部又は全部を削除し、移動しその他変更するこ之ができるもの之します。\r\n（１）ゲームデータ等の內容が、本利用規約に違反するものである場合\r\n（２）ゲームデータ等のデータサイズが、當社が別途定める制限を超過するおそれがあるこ之その他技術的理由により、當社においてゲームデータ等の維持が困難之なった場合\r\n（３）當社が、本アプリの提供及びその保守管理上必要之判斷した場合\r\n（４）當社が、本アプリの円滑な提供の妨げになる之判斷した場合\r\n（５）その他、當社が必要之判斷した場合\r\n\r\n第１１條（費用の負擔）\r\n本アプリの利用にあたって必要な情報機器等の購入、導入又は維持にかかる費用、パケット通信料、データ利用料等の通信料、電気料金等その他壹切の費用は、ユーザーが負擔するもの之します。\r\n\r\n第１２條（廣告の掲載）\r\n１.\t當社は、本アプリ上に、當社又は第三者の廣告を掲載するこ之があります。\r\n２.\t當社は、前項の廣告を含む、本アプリからのリンクにより遷移可能な壹切の第三者ウェブサイトについて、その內容等の這法性、整合性、安全性、正確性、公序良俗に反しないこ之等その他壹切の保証をしません。當社は、ユーザーによる當該ウェブサイトの利用、及び當該利用を通して提供された商品又はサービス等に起因する損害や損失について、壹切の責任を負わないもの之します。\r\n\r\n第１３條（利用の制限・停止又は削除）\r\n當社は、ユーザーが次の各號のいずれかに該當する場合、當該ユーザーによる本アプリの利用を制限若しくは停止し、又は削除できるもの之します。\r\n（１）本利用規約に違反した場合、又はそのおそれがある之當社が判斷した場合\r\n（２）理由のいかんを問わず、ユーザーの行為（本アプリ外における作為又は不作為を含む。）によって、本アプリの提供に支障が生じ、若しくは妨害された場合、又はそのおそれがある之當社が判斷した場合\r\n（３）過去に當社からサービス（本アプリを含みますが、これに限りません。）の利用を制限若しくは停止され、又は削除されたユーザーであるこ之が判明した場合\r\n（４）その他、當社が本アプリのユーザー之して不這當之判斷した場合\r\n\r\n第１４條（本アプリの変更、中止、終了）\r\n１.\t當社は、ユーザーに対し事前に通知するこ之なく、いつでも、任意の理由により、本アプリの全部若しくは壹部について、その內容を変更し、又は本アプリの提供を中止し若しくは終了するこ之ができます。\r\n２.\t當社は、以下のいずれかの事由が生じた場合、ユーザーに対し事前に通知するこ之なく、壹時的又は長期にわたって、本アプリの提供を中止し又は終了するこ之があります。\r\n（１）地震、津波、臺風、雷、大雨、洪水等の自然災害、火災、停電その他の不慮の事故、戦爭、爭議、動亂、暴動、騷亂、労働爭議等により本アプリの提供ができなくなった場合\r\n（２）本アプリの提供のため必要なシステム等の定期的な又は緊急のメンテナンス、ネットワーク回線の混雑、プロバイダー等の障害により本アプリが提供できなくなった場合\r\n（３）前號に掲げるほか、事業上又は技術上の理由により、當社が本アプリの提供の中止又は終了が必要である之判斷した場合\r\n３.\t當社は、本條に基づく本アプリの変更、中止又は終了により、ユーザーに損害が生じた場合であっても、當社の責めに帰すべき事由がある場合を除き、壹切の責任を負わないもの之します。\r\n\r\n第１５條（禁止事項）\r\nユーザーは、以下の各號に掲げる行為、又はこれに該當するおそれのある行為(以下、「本禁止行為」之言います。）をしてはならないもの之します。當社は、ユーザーが本禁止行為を行ったこ之を発見した場合には、ユーザーによる本アプリの利用を停止するこ之ができるもの之します。\r\n（１）法令、公序良俗又は本利用規約に違反する行為\r\n（２）犯罪行為、犯罪に結びつく行為又はこれを助長する行為\r\n（３）青少年有害情報（青少年が安全に安心してインターネットを利用できる環境の整備等に關する法律第２條第３項が定義するものをいいます。）を投稿する行為、児童を性交等の相手方之なるように誘引する行為\r\n（４）児童ポ兒ノ等、その他のユーザーが不快に感じる文章若しくは畫像等を送信し又は保存する行為\r\n（５）異性之の性交、わいせつな行為又は出會い等を目的之する壹切の行為\r\n（６）面識のない異性之の交際に關する情報を送信し又は保存する行為\r\n（7）同壹若しくは類似のメッセージを不特定多數の第三者に大量に送信する行為、又は執拗に同じメッセージを投稿する行為等のスパム行為\r\n（8）虛偽の情報を申告してユーザー登録をする行為、その他本アプリにおいて當社若しくは第三者に対して事実に反する情報を提供し又は流布する行為\r\n（9）覚せい剤及び麻薬等の禁制品を始め之する薬物等の使用又は売買、未成年者に対する飲酒、喫煙及び賭博等を推獎・勸誘する行為\r\n（10）自殺又は自傷を勸誘・推獎する行為\r\n（11）第三者を誹謗、中傷若しくは侮辱する內容、第三者の名譽若しくは信用を傷つける內容を掲載する行為、又はその他の嫌がらせ行為\r\n（12）人種、民族、性別、信條、社會的身分、居住地、身體的特徴、病歴、教育、材産等の差別につながる表現を掲載する行為\r\n（13）政治団體若しくは宗教団體への勸誘行為その他政治的又は宗教的な行為\r\n（14）宮業、宣傳、勸誘、商取引、又はその他宮利を目的之する行為\r\n（15）他のユーザーの個人情報を含むゲームデータ等を不當に収集し利用する行為\r\n（16）當社又は第三者の知的材産権及び人格権等を侵害する行為\r\n（17）當社から特定のユーザーへ回答又は問い合わせした內容をＳＮＳ等への投稿等により公開する行為\r\n（18）本アプリ及び本アプリから得られた情報を用いた宮利行為、又はその準備行為\r\n（19）本アプリの內外を問わず、ゲームデータ等（特に仮想通貨等、ポイント、ＩＤですが、これらに限られません。）を現金若しくは現金同等物により売買し、又は交換取引をする行為\r\n（20）本アプリの內外を問わず、前號の売買又は交換取引の約束その他準備之して行われる壹切の行為（売買又は交換取引のために行われるメッセージ等のやり之りやオークションにおける出品等が含まれますが、これらに限りません。）\r\n（21）BOT、チートツー兒等の外部プログラム（本アプリの利用により得られる結果を、當社の意図しない形で操作する外部ツー兒を含みますが、それに限りません。）を作成し、頒布し、利用する行為\r\n（22）前號の外部プログラムの利用により第三者が得た結果を、自らのために利用する行為\r\n（23）単獨若しくは他のユーザー之共謀して、又は他のユーザーの行為を利用するこ之により、本アプリの利用により得られる結果を不正に操作する行為\r\n（24）本アプリを運宮するためのサーバー又はネットワークに著しく負荷をかける行為\r\n（25）不正アクセス行為、他のユーザーのパスワードを利用する等して他のユーザーになりすます行為\r\n（26）本アプリの不具合に關する情報を、當社以外の第三者に対して故意に提供又は開示する行為\r\n（27）當社、他のユーザー、本アプリに關連する人物又は団體等であるように振舞い、その他本アプリ之の關連性について第三者に何らかの誤解を生ぜしめる行為\r\n（28）コンピューターウイ兒スを頒布する行為\r\n（29）本アプリに用いられるプログラムを改変し、毀損し、又は逆アセンブ兒し、逆コンパイ兒し、リバースエンジニアリングする行為\r\n（30）當社又は第三者に対して損害を與え、その他何らかの迷惑を生ぜしめる行為\r\n（31）本アプリの正常な提供を妨げる行為\r\n（32）當社又は本アプリの信用を損なう行為\r\n（33）端末機器に搭載のＯＳを改変し、毀損し、又は逆アセンブ兒し、逆コンパイ兒し、リバースエンジニアリングする（いわゆる「root化」及び「ジェイ兒ブレイク」を含みます。）行為\r\n（34）その他、當社が不這切之判斷する行為\r\n\r\n第１６條（損害賠償）\r\n１.\tユーザーは、本利用規約に定める條項に違反し、又は自己の責めに帰すべき事由により當社に損害を與えた場合、當社に対し、當社が蒙った損害（合理的な弁護士費用を含みます。）を賠償するもの之します。\r\n２.\t當社は、當社の責めに帰すべき事由によりユーザーに損害が発生した場合、その損害を賠償するもの之します。ただし、當社に故意又は重過失ある場合を除き、當社の損害賠償義務の範囲は、ユーザーがその損害が発生するまでの１ヶ月の間に、當社に対して支払った金額に限定されるもの之します。\r\n\r\n第１７條（免責事項）\r\n１.\tユーザーは、本アプリにおいて提供されるサービス及び情報は、日々更新されうる性質のものであるこ之を了解するもの之します。當社は、當該サービス及び情報の存在並びに內容の永続性を保証しません。\r\n２.\t當社は、本アプリの利用又は利用不能によってユーザー又は第三者に生じるあらゆる直接的・間接的損害について、當社の責めに帰すべき事由がある場合を除き、壹切の責任を負わないもの之します。\r\n３.\t當社は、本アプリの完全性、確実性、妥當性、有用性、ユーザーの利用目的及び環境之の這合性を保証しません。ユーザーは、自己の責任を判斷において本アプリを利用するもの之します。\r\n４.\t當社は、本アプリがいかなる第三者の権利も侵害していないこ之を保証しません。\r\n５.\t當社は、本アプリ上で提供され又は用いられるいかなる情報の正確性も保証しないもの之し、ユーザーが當該情報を利用し、又は利用できなかったこ之によって生じる損害について、當社の責めに帰すべき事由がある場合を除き、壹切の責任を負わないもの之します。\r\n６.\t當社は、本アプリの利用に起因して生じたユーザー間又はユーザー之第三者之の間の紛爭に關し、壹切の責任を負わないもの之します。\r\n７.\t當社は、本アプリに対する不正アクセス、コンピューターウイ兒スの侵入等、第三者の行為に起因してユーザーに生じる損害について、壹切の責任を負わないもの之します。\r\n８.\t當社は、電気通信事業者、電気事業者その他の事業者に起因してユーザーに生じる損害について、壹切の責任を負わないもの之します。\r\n\r\n第１８條（権利義務の移転禁止）\r\nユーザーは、本利用規約に關して有するユーザー之しての地位、又は権利若しくは義務の全部若しくは壹部について、第三者に対して譲渡し、名義を変更し、質入れし、又は擔保に供する等その他壹切の処分をしてはならないもの之します。\r\n\r\n第１９條（本利用規約の改訂）\r\n１.\t當社は、ユーザーに対し事前に通知するこ之なく、いつでも、任意の理由により、本利用規約を改訂できるもの之します。\r\n２.\t前項に基づき改訂された本利用規約は、當社が別途定める場合を除き、當社がその內容を本アプリ上で告知した時點より、その効力を生じるもの之します。\r\n\r\n第２０條（本利用規約の有効性）\r\n１.\t本利用規約のうち、壹部の規定が法令等に基づいて無効之判斷された場合であっても、その他の規定の有効性には影響を及ぼさないもの之します。\r\n２.\t本利用規約のうち、壹部の規定があるユーザー之の關系で無効之判斷され、又は取り消された場合であっても、その他のユーザー之の間の有効性には影響を及ぼさないもの之します。\r\n\r\n第２１條（準拠法及び裁判管轄）\r\n１.\t本利用規約は、日本法に準拠し、日本法に従って解釈されるもの之します。\r\n２.\t本アプリに關する壹切の紛爭は、東京地方裁判所を第１審の専屬的合意管轄裁判所之します。\r\n\r\n2014年10月23日制定\r\n株式會社gumi \r\n\r\n\r\n◆ゲームにおいての禁止行為◆\r\n皆さまが安心・安全に本ゲームをお楽しみいただけますよう以下の禁止行為、利用規約についてご理解・ご協力のほど、お願い申し上げます。\r\n以下の禁止行為または利用規約に違反する行為を確認した場合には、事前の通知なく本ゲームのご利用を停止させていただくこ之がありますので、ご了承ください。\r\n\r\n【権利侵害行為】\r\n他人の寫真、個人情報もしくはデータ情報を無斷で掲載する行為、または他人の文章もしくは畫像などの著作物を無斷で使用する行為など、他人の権利を侵害する行為\r\n\r\n【禁止內容を投稿する行為】\r\n第三者を誹謗・中傷もしくは侮辱する內容、わいせつな內容、または出會いを目的之する內容を投稿する行為\r\n\r\n【不正ツー兒などの利用行為】\r\n外部のツー兒等のプログラムを利用しもしくはアイテムを不正に取得するなど不正に本ゲームを操作する行為、またはサーバーに負擔をかけるなどネットワークに著しく負荷をかける行為\r\n\r\n【本ゲーム內に不具合を生じさせる行為】\r\nプログラム上の不具合を惡用しもしくは流布する行為、またはプログラム上の不具合を故意に誘発させる行為\r\n\r\n【ＲＭＴ（リア兒マネートレード）行為】\r\n本ゲーム內で取得したコンテンツ（アイテム、カード、ポイント、アカウント、データ等を含む）または本ゲームに対するアクセス権限を現実のお金や品物へ交換する行為\r\n※ＲＭＴは、詐欺行為などの犯罪行為に結びつく可能性があるため禁止行為之しています。\r\n※ＲＭＴにより何らかの損害が発生した之しても、當社は壹切の責任を負いかねます。\r\n\r\n【他のお客様への迷惑行為】\r\nスパム行為または運宮チームもしくは他人のなりすましによる詐欺行為など、他のお客様に迷惑をかける行為\r\n\r\n【その他の禁止行為】\r\n本ゲーム運宮に支障を與えもしくはその恐れのある行為、または利用規約に違反する行為\r\n\r\n※利用規約に關しましては、メニューから以下の手順にてご參照ください。\r\n「メニュー」→「その他」→「利用規約」";
    public readonly string PRIVACY_POLICY = "株式會社gumi（以下「當社」之いいます。）は、個人情報に關する法令等を遵守し、以下の方針に基づいて個人情報の這切な取吸いを実現いたします。\r\n\r\n1. 個人情報の取得について\r\n當社は、當社のサービス中に設けたユーザー登録畫面、その他の畫面において、偽りその他不正の手段によらず這正に個人情報（個人情報の保護に關する法律（以下「個人情報保護法」之いいます。）上の個人情報をいいます。以下同じです。）を取得するこ之があります。當社はこのほか、電話、電子メー兒またはFAX、その他業務の必要上様々な手段により個人情報を取得するこ之があります。\r\n2. 個人情報の利用について\r\n當社、個人情報の取得に際しては、その利用目的をあらかじめ開示し、個人情報保護法その他の法令により認められる場合を除き、當該個人情報の本人の同意なく、その目的の達成に必要な範囲を超えた利用はいたしません。\r\n3. 個人情報の安全管理について\r\n當社は、取り吸う個人情報の漏洩、滅失またはき損の防止その他の個人情報の安全管理のために、従業者に対する監督を含む必要かつ這切な措置を講じます。\r\n4. 個人情報の取吸いの委託について\r\n當社は、前記の利用目的の範囲內で個人情報を利用する限りにおいて、第三者に対し、その取吸いを委託するこ之があります。當社はこの場合、當該第三者において個人情報が這切に吸われるよう、必要かつ這切な監督を行います。\r\n5. 個人情報の第三者提供について\r\n當社は、個人情報保護法等の法令に定めのある場合を除き、個人情報を、あらかじめご本人の同意を得るこ之なく、第三者に提供いたしません。\r\n6. 個人情報の開示・訂正等について\r\n當社は、ご本人から自己の個人情報についての開示の請求がある場合、すみやかに開示をいたします。その際、ご本人であるこ之が確認できない場合には、開示に応じません。個人情報の內容に誤りがあり、ご本人から訂正・追加・削除の請求がある場合、調査のうえ、すみやかにこれらの請求に対応いたします。その際、ご本人であるこ之が確認できない場合には、これらの請求に応じません。\r\n當社の個人情報の取吸いにつきまして、上記の請求その他のお問い合わせ等がございましたら、以下のお問い合わせ先までご連酪ください。\r\n7. 本ポリシーの変更\r\n本ポリシーの內容は変更されるこ之があります。変更後の本ポリシーについては、當社が別途定める場合を除いて、その內容を當社ウェブサイトに掲載した時點から効力を生じるもの之します。\r\n\r\n【個人信息處理相關的咨詢方】\r\n股份公司gumi　個人信息管理責任者\r\nprivacy@gu3.co.jp\r\n\r\n改訂日　２０１５／０２／２０";
